// src/pages/AddSermon.js
import React from 'react';
import AddSermonForm from '../components/AddSermonForm';

const AddSermon = () => {
  return (
    <div>
      <h1>Add a New Sermon</h1>
      <AddSermonForm />
    </div>
  );
};

export default AddSermon;
